import React, { useEffect, useState } from 'react';
import axios from 'axios';  // Import axios for making HTTP requests
import '../styles/Profile.css';

const Profile = () => {
  const [user, setUser] = useState(null);
  const [isEditing, setIsEditing] = useState(false);
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
  });
  const [error, setError] = useState(null);  // State to handle error messages
  const [loading, setLoading] = useState(true);  // State to handle loading
  const storedUser = localStorage.getItem('user');
  const userId = storedUser ? JSON.parse(storedUser)?.id : null;  // Retrieve user ID from localStorage

  useEffect(() => {
    const fetchUserData = async () => {
      if (!userId) {
        console.error('No user ID found in localStorage');
        setLoading(false);
        window.location.href = '/login';
        return;
      }

      try {
        const response = await axios.get(`http://localhost:5001/user/user/${userId}`);
        setUser(response.data.user);
        setFormData(response.data.user);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching user data:', error);
        setError('Error fetching user data.');
        setLoading(false);
      }
    };

    fetchUserData();
  }, [userId]);

  const handleEditClick = () => {
    setIsEditing(true);
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSave = async () => {
    try {
      const response = await axios.put(`http://localhost:5001/user/user/${userId}`, formData);
      setUser(response.data.user);
      localStorage.setItem('user', JSON.stringify(response.data.user));
      setIsEditing(false);
    } catch (error) {
      console.error('Error updating user data:', error);
      setError('Error updating user data.');
    }
  };

  const handleCancel = () => {
    setFormData(user);
    setIsEditing(false);
  };

  if (loading) return <p>Loading...</p>;  // Show loading indicator while data is being fetched

  return (
    <div className="profile-container">
      <h2 className="profile-heading">Profile</h2>
      {error && <p className="error-message">{error}</p>} {/* Display error message if any */}
      <div className="profile-details">
        {!isEditing ? (
          <>
            <p><strong>Name:</strong> {user.name}</p>
            <p><strong>Email:</strong> {user.email}</p>
            <p><strong>Phone:</strong> {user.phone}</p>
            <button onClick={handleEditClick} className="edit-button">Edit</button>
          </>
        ) : (
          <div className="edit-form">
            <label>
              Name:
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
              />
            </label>
            <label>
              Email:
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                disabled
              />
            </label>
            <label>
              Phone:
              <input
                type="text"
                name="phone"
                value={formData.phone}
                onChange={handleChange}
              />
            </label>
            <button onClick={handleSave} className="save-button">Save</button>
            <button onClick={handleCancel} className="cancel-button">Cancel</button>
          </div>
        )}
      </div>
    </div>
  );
};

export default Profile;
